import React from 'react';
import { Jumbotron,Button,Container} from "reactstrap";

const Home = () =>
{
return(
    <div>
       <Jumbotron className="text-center bg-success">
           <h1>
              This is my React Application
           </h1>
           <Container>
               <Button color="primary">Start Using</Button>
           </Container>
       </Jumbotron>
    </div>
)
};
export default Home;
